import { NgModule } from '@angular/core';
import { RouterModule, Routes } from '@angular/router';
import { CommonModule } from '@angular/common';
import { WelcomeComponent } from './landing/welcome/welcome.component';

const routes: Routes = [
  {
    path: '', // Define una ruta vacía para la página de inicio
    component: WelcomeComponent, // Asigna el componente "welcome" a la ruta
  },
  // Agrega otras rutas aquí según sea necesario
];


@NgModule({
  declarations: [],
  imports: [
    CommonModule,
    RouterModule.forRoot(routes)
  ]
})
export class AppRoutingModule { }
